import React from "react";
import { Box } from '@material-ui/core';

function NotesIcon() {
    return (
        <Box
        sx={{
            width: '60px',
            height: '60px'
        }}
            component='img'
            src='dexter/public/vectors/notesIcon.svg'
            alt='notes_logo'
        />
    )
}

export default NotesIcon;
